import React from "react";
import "./App.css";
import { BacklogProvider } from "./contexts/BacklogContext";
import BacklogDisplay from "./displays/BacklogDisplay";
import AddBacklog from "./AddBacklog";

function App() {
  return (
    <BacklogProvider>
      <SprintProvider>
        <div className="App">
          <BacklogDisplay />
          <AddBacklog />
        </div>
      </SprintProvider>
    </BacklogProvider>
  );
}

export default App;
